BASSA FREQUENZA DI ALLENAMENTO: 
VANTAGGI: - ovviamente si ha maggior tempo per recuperare dagli allenamenti e quindi minore rischio di incombere in infortuni;
SVANTAGGI: - nei singoli allenamenti occorre allenarsi maggiormente per poter creare più volume; - minore è la frequenza di allenamento e minore sarà la possibilità di allenare la tecnica a dovere. 
ALTA FREQUENZA DI ALLENAMENTO: 
VANTAGGI: - mantenere una frequenza più elevata sembrerebbe far ottenere maggiori risultati; - allenare un esercizio spesso aiuta a migliorare e mantenere la tecnica; - permette di allenarsi di meno nei singoli allenamenti;
SVANTAGGI: - Il rischio di affaticarsi è maggiore;
- se la tecnica degli esercizi non è ottimale aumenta il rischio di infortunarsi.

A grandi linee questi sono gli svantaggi e i vantaggi di un’alta e bassa frequenza di allenamento. Ovviamente la frequenza ottimale dipende dall'esperienza di allenamento del soggetto, dai suoi obiettivi e dalle sue preferenze.

Qui sotto vi stilerò una lista degli integratori più utili e per cui vale la pena spendere dei soldi secondo il mio parere: 
1)	proteine in polvere: potrebbero risultare molto utili in diete ipocaloriche/fortemente ipocaloriche o quando non si raggiunge un’adeguata quota giornaliera di proteine.
Se volete approfondire sulla pagina è già presente un articolo sulle whey; 
2)	la creatina: uno degli integratori con più studi scientifici alle spalle. Anche qui vi esorto di andare a leggere i post presenti sulla pagina riguardanti la creatina se volete avere più informazioni; 
3)	Integratore di omega 3: -	EPA e DHA se non mangiate pesce frequentemente (2/4 volte a settimana); -	ALA se non mangiate frutta secca, oli vegetali specifici e determinate verdure quotidianamente; 
4)	vitamina D: vitamina importantissima per il nostro organismo e di cui la maggior parte della popolazione è carente. Sulla pagina sono presenti post su di essa sempre se volete approfondire; 
5)	mutivitaminico o integratori di vitamine/minerali singoli: utili quotidianamente, in diete ipocaloriche/fortemente ipocaloriche, quando si escludono determinati cibi dall’alimentazione o quando non si arriva ad una quota giornaliera idonea di un micronutriente o più; 
Esistono altri integratori che potrebbero essere utili in determinate situazioni o esigenze, ma questi rimangono i più utili.
Prima di iniziare qualsiasi integrazione vi consiglio vivamente di sentir il parere di un medico o di un professionista esperto in materia, non tutti gli integratori riportati potrebbero fare al caso vostro.
